import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Home from "./pages/Home";
import Shop from "./pages/Shop";
import About from "./pages/About";
import Contact from "./pages/Contact";
import Cart from "./pages/Cart";       // New Import
import Reviews from "./pages/Reviews"; // New Import
import SignUp from "./pages/SignUp";   // New Import
import "./App.css";

function App() {
  return (
    <Router>
      <Navbar />
      <div className="container my-4">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/shop" element={<Shop />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/cart" element={<Cart />} />           {/* New Route */}
          <Route path="/reviews" element={<Reviews />} />     {/* New Route */}
          <Route path="/signup" element={<SignUp />} />       {/* New Route */}
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
